import './LeftChatItem.css';
import React from 'react';


function LeftChatItem({chat}) {

    return (
        <div className='left-chat-item row'>
            {/* <div className='col'> */}
            <h5 className="chat-member-name">{chat.currentUsername}</h5>
            <span className="chat-last-message">{chat.lastMessage}&nbsp</span>
            <span className='last-message-time'>{chat.time} minutes ago</span>
            {/* </div> */}
        </div>
    );
}
export default LeftChatItem;
